function init_localStor_chartData() {
    
    var chartData=[];
    
     //alert("chartData");
    d=new Date();
    y= d.getFullYear();
    mon= d.getMonth();
    day= d.getDate();
    
     for (var i = 0; i < 365; i++) {
         // Startpunkt aktuelles Datum -365 Tage, also immer vor einem Jahr
    var newDate = new Date(y, mon, (day-365+i));
    //newDate.setHours(0, i, 0, 0);
    var a = Math.round((Math.random() + 80) *10)/10;
    var b = Math.round(Math.random() * 400) + 1800;

    chartData.push({
      date: newDate,
      value: a,
      volume: b
    });
    //$("#abcd").append("<div>"+chartData[i]['date']+"  value:"+chartData[i]['value']+"  vol:"+chartData[i]['volume']+"</div>");
    var key = "$fap_wkci"+(i).toString()+"$";
    localStorage.setItem(key, JSON.stringify(chartData[i]));
 
  }

  localStorage.setItem("$fap_nowkcis$", JSON.stringify(i-1));
}
 
       